import React from "react";
import "./style.css";
import LinkedIn from '@material-ui/icons/LinkedIn';


function Footer() {
  return (
    <footer className="footer">
      <span>R.A. Portfolio 2020</span>
      <Row>
      <LinkedIn 
        style={{
          alignItems: 'center',
          color: 'white',
          fontSize: '60px',
          margin: 0

      }}/>
      </Row>
    </footer>
  );
}
export default Footer;
